comment:
지금 사람들이 화장으로 어떻게 저러냐라는 댓글이 많은데
유튜브에다가 화장전후 쳐보세요. 진짜 안믿김
사람들 보게 배댓좀..;;

베댓에서 혜준님 남자보고 뭐라하지마세요;
님이나 잘하고다니셈
ㄹㅇ남한테나 이래라저래라하는 꼰대불편충 개극혐

배뎃웃기네
여기서 얼평 몸평하지말라고하지
정작 현실에서는 지들이 더 하면서 착한척 위선떨긴;

아 화장 안 한게 더 나은건 맞음
중학교 애들 수도권쪽은 화장 엄청 하는데 쌩얼이 더 괜찮겠다
굳이 그렇게 떡칠을...;;

저 사람은 이쁘고 잘생겼으니까 사람도 좋을거다 라고 하는게 품평이고
와 저사람 엄청 이쁘다 잘생겼다 는 그냥 외모를 보고 감탄하는거임
이 머가리 텅텅 빈 것들아 언어시간에 눈 뜨고 귀만 열고 있었어도 차이점 알겠다 ;

아 이런 코르셋 스토리  너무 싫어 진짜 
이쁜 여자가 살기 더 편하다는 건 진짜 주관적인 지 생각이고;
왜 여자는 꼭 예뻐져야되는건데 ,, 제발 못생긴남자들이나 관리하는 웹툰 그려줘요;

여기서 익명으로 싸우지말고 링위에서 얼굴까고 스파링하셈;;;
작가님 힘들게 작품활동하시는데 님들이 싸우는 댓글만 봇물터지듯 넘쳐나면
웹툰 그릴맛 나시겠나요;;
싸우실분들은 시간이랑 장소정해서 현피뜨던디 하세요

나는 왜 저게 공감되는거지;;
우리 남동생은 쌍꺼풀도 있고, 눈도 겁나 크고, 얼굴도 귀엽게 생기고...성격도 좋은데;;
난 쓰레기인건가... 유전자 몰빵인건가...

쌍액으로 쌍커플 만들고 눈 커질려고 하지만 나중에는 후회 하실껄요 ㅎㅎ??
결국 부작용 생긴답니다~~ 언젠간 부작용이 생겨요^^;;;

제가 왜 이런말을 하나? 진짜 만화처럼 순해지고 귀여운눈을 가지게 되고 몇년동안 주말에만 했는데 눈피부살이 축...쳐지고 탄력이 없어지고 세수할때마다 주름때문에 부작용은 이렇게 무서워요 제가 말해도 못알아 듣을순있겠지만. 부작용 겪은사람만 압니다
